              "type": "string",
              "metadata": {
                "description": "Admin username"
              }
            },
            "adminPassword": {
              "type": "securestring",
              "metadata": {
                "description": "Admin password"
              }
            },
            "dnsNameforLBIP": {
              "type": "string",
              "metadata": {
                "description": "DNS for Load Balancer IP"
              }
            },
            "vmNamePrefix": {
              "type": "string",
              "defaultValue": "myVM",
              "metadata": {
                "description": "Prefix to use for VM names"
              }
            },
            "imagePublisher": {
              "type": "string",
